import Link from "next/link";
const NaveBar = () => (
  <nav className="navbar">
    <ul className="navbar-nav mr-auto">
      <Link href={"/create"}>
        <li className="nav-item">
          <a className="nav-link">Create</a>
          <span>
            <i className="fas fa-plus"></i>
          </span>
        </li>
      </Link>
    </ul>
  </nav>
);
export default NaveBar;
